// Helper functions

// Get all unique values for a field
function getUniqueValues(field) {
    return [...new Set(batchesArray.map(b => b[field]))];
}

// Filter batches
function filterBatches(filters) {
    return batchesArray.filter(batch => {
        return Object.entries(filters).every(([key, value]) => {
            return !value || batch[key] === value;
        });
    });
}

// Count by field
function countByField(field) {
    const counts = {};
    batchesArray.forEach(b => {
        const val = b[field];
        counts[val] = (counts[val] || 0) + 1;
    });
    return counts;
}

